import React from "react";
import { useAuth } from "../context/AuthContext";

const DoctorDashboard = () => {
  const { logout } = useAuth();

  return (
    <div>
      <header style={{ display: "flex", justifyContent: "space-between", padding: "1rem", backgroundColor: "#e0e0e0" }}>
        <div><strong>Logo</strong></div>
        <button onClick={logout}>Sign Out</button>
      </header>
      <aside style={{ float: "left", width: "200px", padding: "1rem" }}>
        <p>Schedule</p>
        <p>Patients</p>
        <p>Prescriptions</p>
      </aside>
      <main style={{ marginLeft: "210px", padding: "1rem" }}>
        <h2>Doctor Content</h2>
      </main>
    </div>
  );
};

export default DoctorDashboard;
